import React from 'react'

export default function Func(props) {




  return (
    <div>
      <div>
        
        <div class="list-type5 mt-5">
          <ol>
            
                 {props.pr.map((it) => 
                 <li>{it.title}</li>
                 )} 
          </ol>
        </div>
      </div>
    </div>
  )
}
